          </a>
        </div>
        <nav className={(open?"flex":"hidden")+"flex-col items-center flex-grow hidden px-5 md:pb-0 md:flex md:justify-end md:flex-row"}></nav>
        </div>
      </header>
		</div>
	);
}

export default App;
